import React from "react";
import "./navbar.css";
import { NavLink } from "react-router-dom";

const link = {
  width: "100px",
  padding: "12px",
  margin: "0 6px 6px",
  background: "blue",
  textDecoration: "none",
  color: "white"
};
class Navbar extends React.Component {
  render() {
    return (
      <div>
        <NavLink
          to="/signup"
          exact
          style={link}
          activeStyle={{
            background: "darkblue"
          }}
        >
          Signup
        </NavLink>
        <NavLink
          to="/profile"
          exact
          style={link}
          activeStyle={{
            background: "lightblue"
          }}
        >
          profile
        </NavLink>
        <NavLink
          to="/login"
          exact
          style={link}
          activeStyle={{
            background: "lightblue"
          }}
        >
          Login
        </NavLink>
      </div>
    );
  }
}
export default Navbar;
